/*Table structure for table `movimientos` */

DROP TABLE IF EXISTS `movimientos`;

CREATE TABLE `movimientos` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `tipo` int(11) DEFAULT NULL,
  `idTipo` int(11) DEFAULT NULL,
  `idCuenta` int(11) DEFAULT NULL,
  `fecha` date DEFAULT NULL,
  `idsucursal` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

/*Data for the table `movimientos` */

insert  into `movimientos`(`id`,`tipo`,`idTipo`,`idCuenta`,`fecha`,`idsucursal`) values (2,1,2,1,'2019-08-23',1),(5,2,2,1,'2019-08-23',1);

/*Table structure for table `premios` */

DROP TABLE IF EXISTS `premios`;

CREATE TABLE `premios` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `descripcion` varchar(50) DEFAULT NULL,
  `costo` int(11) DEFAULT NULL,
  `imagen` int(11) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;

/*Data for the table `premios` */

insert  into `premios`(`id`,`descripcion`,`costo`,`imagen`,`status`) values (1,'balon',5,28,1),(5,'Paraguas',10,29,1),(7,'sarten',30,31,1),(12,'laptop',99,36,1),(15,'admin',4,39,1),(17,'unicornio',20,41,1),(19,'lirio',55,43,1);

/*Table structure for table `premiosucursal` */

DROP TABLE IF EXISTS `premiosucursal`;

CREATE TABLE `premiosucursal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idsucursal` int(11) DEFAULT NULL,
  `idpremio` int(11) DEFAULT NULL,
  `cantidad` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idsuc` (`idsucursal`),
  KEY `idprem` (`idpremio`),
  CONSTRAINT `idprem` FOREIGN KEY (`idpremio`) REFERENCES `premios` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `idsuc` FOREIGN KEY (`idsucursal`) REFERENCES `sucursal` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;

