/* Procedure structure for procedure `canjearMovi` */

/*!50003 DROP PROCEDURE IF EXISTS  `canjearMovi` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `canjearMovi`(IN idsucursal int, IN idcuenta int, IN idPremio int)
BEGIN
	/*declare puntosPremio int;*/
	/*start transaction = on;*/
	/*SET autocommit = 0;*/
	DECLARE result INT;
    declare countres int;
	
	DECLARE puntoscuenta INT;
	SELECT premios.`id`, premios.`costo`, premiosucursal.`cantidad` INTO @idpremio, @costopremio, @dispopremio
	FROM premios INNER JOIN premiosucursal ON premios.`id` = premiosucursal.`idpremio` 
	WHERE premios.`id` =  idPremio AND premiosucursal.`idsucursal` = idsucursal;
	SET puntoscuenta = (SELECT cuenta.`puntos` FROM cuenta WHERE id = idcuenta);
	set countres = 0;
	IF(@dispopremio > 0 AND puntoscuenta >= @costopremio) THEN
		
		IF(puntoscuenta >= @costopremio) THEN
		    start transaction;
		    UPDATE cuenta SET puntos=(puntos-@costopremio) WHERE id = idcuenta AND puntos >= @costopremio;
		    set countres = countres + (SELECT ROW_COUNT());
		    UPDATE premiosucursal SET cantidad = cantidad - 1 WHERE premiosucursal.idsucursal = idsucursal AND premiosucursal.idpremio = idPremio and premiosucursal.cantidad > 0;
		    set countres = countres + (SELECT ROW_COUNT());
		    IF(countres = 2) THEN
		        INSERT INTO canjeos SET canjeos.idPremio = idPremio;##Inserta el canjeo
                INSERT INTO movimientos(tipo,idTipo,idCuenta,movimientos.idsucursal,fecha) VALUES (2, LAST_INSERT_ID(), idcuenta, idsucursal,NOW());#inserta el movimiento no es mejor ponerlo al final?
		        commit ;
		        SET result = 1;
		        SELECT 'Completado' AS 'resultString', result AS 'res';
            else
                rollback ;
		        set result = 0;
			    SELECT 'No puntos disponibles' AS 'resultString', result AS 'res';
            end if;
		else
		    set result = 0;
			SELECT 'No puntos disponibles' AS 'resultString', result AS 'res';
		end if;
	ELSE
	    SET result = -1;
        SELECT 'No_premios disponibles' AS 'resultString', result AS 'res';
	END IF;
END */$$
DELIMITER ;

